    "ep_dsc_0001"              : "\u6545\u90F7\u306E\u60D1\u661F\u304B\u3089\u5358\u8EAB\u98DB\u3073\u51FA\u3057\u3001\u5FF5\u9858\u306E\n\u30AA\u30FC\u30C7\u30A3\u30B7\u30E7\u30F3\u3078\u3068\u53C2\u52A0\u3059\u308B\u30D5\u30EC\u30A4\u30A2\u3002\n\u6301\u3066\u308B\u529B\u3092\u3059\u3079\u3066\u51FA\u3057\u5207\u3063\u305F\u305D\u306E\u7D50\u679C\u306F\uFF1F",
