    "ep_dsc_0220"              : "\u60F3\u3044\u306F\u5FC5\u305A\u3057\u3082\u6210\u5C31\u3059\u308B\u308F\u3051\u3067\u306F\u306A\u3044\u3002\n\u3067\u3082\u672C\u6C17\u3060\u3063\u305F\u306E\u306A\u3089\u5F8C\u6094\u306F\u306A\u3044\u306F\u305A\u3002\n\u3042\u308B\u3068\u3059\u308C\u3070\u307B\u3093\u306E\u5C11\u3057\u306E\u5207\u306A\u3055\u3060\u3051\u2026",
    "ep_dsc_0221"              : "\u604B\u611B\u6A21\u69D8\u306E\u5909\u5316\u306B\u80F8\u3092\u30C1\u30AF\u30C1\u30AF\u3055\u305B\u308B\n\u306E\u3082\u3001\u30D0\u30EC\u30F3\u30BF\u30A4\u30F3\u306E\u98A8\u7269\u8A69\u3002\u629C\u304D\u3064\n\u629C\u304B\u308C\u3064\u3001\u4E00\u77AC\u306E\u6CB9\u65AD\u304C\u547D\u53D6\u308A\u3067\u3042\u308B\u3002",
    "ep_dsc_0222"              : "\u30C1\u30E7\u30B3\u30EC\u30FC\u30C8\u306B\u3060\u3063\u3066\u8CA0\u3051\u306A\u3044\u30DE\u30AD\u30CA\u306E\n\u7518\u304F\u3066\u30AD\u30E5\u30FC\u30C8\u306A\u6B4C\u58F0\u3002\u304D\u3063\u3068\u3075\u3093\u308F\u308A\n\u512A\u3057\u304F\u3068\u308D\u3051\u3055\u305B\u3066\u304F\u308C\u308B\u3053\u3068\u3060\u308D\u3046\u3002",
    "ep_dsc_0223"              : "\u6551\u4E16\u4E3B\u306E\u540D\u3092\u3042\u3084\u304B\u3063\u305FVF-25\u3002\n\u30E9\u30F3\u30AB\u3082\u307E\u305F\u3001\u6B4C\u3067\u30D0\u30B8\u30E5\u30E9\u3068\u4EA4\u6D41\u3092\n\u679C\u305F\u3057\u305F\u6551\u4E16\u4E3B\u3068\u3044\u3048\u308B\u304B\u3082\u3057\u308C\u306A\u3044\u3002",
    "ep_dsc_0224"              : "\u5B87\u5B99\u6700\u5F37\u306E\u547C\u3073\u58F0\u3082\u9AD8\u3044YF-29\u3002\n\u9280\u6CB3\u306E\u5996\u7CBE\u306E\u6B4C\u304C\u5408\u308F\u3055\u308C\u3070\u3001\u307E\u3055\u306B\n\u9280\u6CB3\u3092\u9707\u308F\u3059\u30D0\u30EB\u30AD\u30EA\u30FC\u3068\u306A\u308B\u3060\u308D\u3046\u3002",
    "ep_dsc_0225"              : "\u304A\u624B\u88FD\u30B3\u30F3\u30D4\u30E5\u30FC\u30BF\u30FC\u30A6\u30A3\u30EB\u30B9\u3092\u5F93\u3048\u3001\n\u30CD\u30C3\u30C8\u30EF\u30FC\u30AF\u3092\u7A81\u304D\u9032\u3093\u3067\u3044\u304F\u30EC\u30A4\u30CA\u3002\n\u305D\u306E\u63A2\u6C42\u5FC3\u306F\u3068\u3069\u307E\u308B\u3053\u3068\u3092\u77E5\u3089\u306A\u3044\u3002",
    "ep_dsc_0226"              : "\u7DCA\u5F35\u3092\u548C\u3089\u3052\u308B\u52B9\u679C\u304C\u3042\u308B\u304B\u3068\u601D\u3048\u3070\u3001\n\u9006\u306B\u8208\u596E\u3055\u305B\u305F\u308A\u3082\u3059\u308B\u30C1\u30E7\u30B3\u30EC\u30FC\u30C8\u3002\n\u4EBA\u306E\u5FC3\u3092\u60D1\u308F\u3059\u7F6A\u4F5C\u308A\u306A\u7518\u5473\u3068\u3044\u3048\u308B\u3002",
    "ep_dsc_0227"              : "\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u521D\u671F\u306E\u3053\u308D\u304B\u3089\u69D8\u3005\u306A\u5F62\u3067\n\u5973\u795E\u3092\u652F\u3048\u3066\u304D\u305F\u30C7\u30EB\u30BF\u5C0F\u968A\u3002\u5F7C\u3089\u3053\u305D\n\u30D5\u30A1\u30F3\u7B2C1\u53F7\u3068\u3044\u3048\u308B\u306E\u304B\u3082\u3057\u308C\u306A\u3044\u3002",
