    "ep_dsc_0392"              : "\u30D5\u30A3\u30AE\u30E5\u30A2\u30B9\u30B1\u30FC\u30C8\u306E\u898B\u305B\u5834\u3068\u3044\u3048\u3070\n\u83EF\u9E97\u306A\u30B8\u30E3\u30F3\u30D7\u3002\u3075\u308F\u3075\u308F\u306A\u30DC\u30C7\u30A3\u3092\n\u3044\u304B\u305B\u3070\u30014\u56DE\u8EE2\u8D8A\u3048\u3082\u5922\u3058\u3083\u306A\u3044\uFF01\uFF1F",
    "ep_dsc_0393"              : "\u30B9\u30B1\u30FC\u30C8\u30EA\u30F3\u30AF\u3067\u8EFD\u3084\u304B\u306B\u821E\u3046\u6F14\u8005\u306E\n\u59FF\u306F\u307E\u3055\u306B\u6C37\u4E0A\u306E\u83EF\u3002\u821E\u3044\u4E0A\u304C\u308B\u6C37\u306E\n\u304D\u3089\u3081\u304D\u3068\u3001\u523A\u6FC0\u7684\u306A\u6F14\u6280\u304C\u5FC3\u3092\u8CAB\u304F\u3002",
