    "sn_dsc_0215"              : "\u60D1\u661F\u30E9\u30B0\u30CA\u306B\u306F\u3001\u30AF\u30E9\u30B2\u3092\u30E2\u30C1\u30FC\u30D5\u306B\u3057\u305F\u540D\u7523\u7269\u304C\u6570\u591A\u304F\u5B58\u5728\u3059\u308B\u3002\n\u30AF\u30E9\u30B2\u9945\u982D\u3082\u305D\u306E\u5185\u306E\u3072\u3068\u3064\u3067\u3001\u30AF\u30E9\u30B2\u796D\u308A\u306E\u591C\u5E97\u3067\u3082\u632F\u308B\u821E\u308F\u308C\u3066\u3044\u305F\u3002",
    "sn_dsc_0216"              : "\u30DE\u30AF\u30ED\u30B9\u30FB\u30A8\u30EA\u30B7\u30AA\u30F3\u306E\u8266\u4E0A\u3067\u3001\u9759\u304B\u306B\u9152\u3092\u98F2\u307F\u4EA4\u308F\u3059\u30A2\u30E9\u30C9\u3068\u30A2\u30FC\u30CD\u30B9\u30C8\u3002\n\u300C\u30A6\u30A3\u30F3\u30C0\u30DF\u30A2\u306B\u306F\u7E01\u304C\u3042\u308B\u3088\u3046\u3060\u3001\u30CF\u30E4\u30C6\u30FB\u30A4\u30F3\u30E1\u30EB\u30DE\u30F3\u306F\u300D\u2015\u30A2\u30E9\u30C9",
    "sn_dsc_0217"              : "\u6B7B\u795E\u30E1\u30C3\u30B5\u30FC\u3068\u767D\u9A0E\u58EB\u30AD\u30FC\u30B9\u3002\u904B\u547D\u306B\u5C0E\u304B\u308C\u305F2\u4EBA\u306E\u30A8\u30FC\u30B9\u304C\u3053\u3053\u306B\u9082\u9005\u3059\u308B\u3002\n\u300C\u6B7B\u795E\u2026\u300D\u2015\u30AD\u30FC\u30B9",
    "sn_dsc_0218"              : "\u30C7\u30EB\u30BF\u5C0F\u968A\u306E\u30A8\u30FC\u30B9\u30D1\u30A4\u30ED\u30C3\u30C8\u3002\u968A\u9577\u306E\u30A2\u30E9\u30C9\u3092\u3082\u51CC\u3050\u64CD\u7E26\u6280\u8853\u3092\u6301\u3064\u3002\n\u30CF\u30E4\u30C6\u3089\u306E\u6559\u5B98\u5F79\u3082\u52D9\u3081\u3066\u304A\u308A\u3001\u3042\u3048\u3066\u8F9B\u8FA3\u306A\u614B\u5EA6\u3092\u3068\u3063\u3066\u5F7C\u3089\u3092\u935B\u3048\u3066\u3044\u308B\u3002",
    "sn_dsc_0219"              : "\u6700\u65B0\u6280\u8853\u3092\u60DC\u3057\u307F\u306A\u304F\u4F7F\u7528\u3057\u305F\u3001\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u306E\u8FEB\u529B\u3042\u308B\u30E9\u30A4\u30D6\u3002\n\u7F8E\u96F2\u306E\u632F\u4ED8\u306B\u5408\u308F\u305B\u3066\u300ES\u300F\u300EO\u300F\u300ES\u300F\u306E\u6587\u5B57\u304C\u6D6E\u304B\u3073\u4E0A\u304C\u308B\u3002",
    "sn_dsc_0220"              : "\u66B4\u308C\u72C2\u3046\u30F4\u30A1\u30FC\u30EB\u5316\u3057\u305F\u5175\u58EB\u3002\u8857\u306F\u7834\u58CA\u3068\u6DF7\u4E71\u306E\u6E26\u306B\u98F2\u307F\u8FBC\u307E\u308C\u3066\u3044\u304F\u3002\n\u3060\u304C\u30F4\u30A1\u30FC\u30EB\u306B\u3088\u308B\u60B2\u5287\u304C\u3042\u308B\u3068\u304D\u3001\u305D\u3053\u306B\u306F\u5FC5\u305A\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u304C\u73FE\u308C\u308B\u306E\u3060\u3002",
    "sn_dsc_0221"              : "\u5BC6\u822A\u306B\u6210\u529F\u3057\u305F\u304B\u306B\u601D\u3048\u305F\u30D5\u30EC\u30A4\u30A2\u3060\u304C\u3001\u5076\u7136\u306B\u3082\u30CF\u30E4\u30C6\u306B\u767A\u898B\u3055\u308C\u3066\u3057\u307E\u3046\u3002\n\u300C\u884C\u304D\u306A\u3088\u300D\u300C\u3069\u3046\u305B\u30EF\u30B1\u3042\u308A\u306A\u3093\u3060\u308D\uFF1F\u300D\u2015\u30CF\u30E4\u30C6",
    "sn_dsc_0222"              : "\u8DEF\u5730\u88CF\u3067\u30D5\u30EC\u30A4\u30A2\u3068\u8A71\u3057\u3066\u3044\u305F\u30CF\u30E4\u30C6\u306F\u3001\u7A81\u7136\u73FE\u308C\u305F\u5973\u6027\u306B\u7D44\u307F\u4F0F\u305B\u3089\u308C\u3066\u3057\u307E\u3046\u3002\n\u30CF\u30E4\u30C6\u3092\u5BC6\u822A\u72AF\u3068\u52D8\u9055\u3044\u3057\u305F\u30DF\u30E9\u30FC\u30B8\u30E5\u3068\u540D\u4E57\u308B\u5973\u6027\u306F\u3001\u3042\u306E\u30C7\u30EB\u30BF\u5C0F\u968A\u306E\u968A\u54E1\u3060\u3063\u305F\u3002",
    "sn_dsc_0223"              : "\u30D5\u30EC\u30A4\u30A2\u306E\u6B4C\u58F0\u306B\u5BBF\u308B\u529B\u3092\u3001\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u306E\u30E1\u30F3\u30D0\u30FC\u306F\u78BA\u304B\u306B\u611F\u3058\u53D6\u3063\u3066\u3044\u305F\u3002\n\u300C\u3053\u306E\u58F0\uFF01\u300D\u300C\u80F8\u304C\u30C1\u30AF\u30C1\u30AF\u3063\u3066\u300D\u2015\u30DE\u30AD\u30CA\u3001\u30EC\u30A4\u30CA",
    "sn_dsc_0224"              : "\u80CC\u5F8C\u304B\u3089\u8FEB\u308A\u304F\u308B\u30DF\u30B5\u30A4\u30EB\u306B\u3001\u30CF\u30E4\u30C6\u306F\u5484\u55DF\u306E\u53CD\u5FDC\u3067\u64CD\u7E26\u687F\u3092\u5012\u3057\u305F\u3002\n\u53EB\u3076\u30CF\u30E4\u30C6\u306B\u5FDC\u3048\u308B\u304B\u306E\u3088\u3046\u306B\u3001\u30D0\u30EB\u30AD\u30EA\u30FC\u306F\u7A7A\u9AD8\u304F\u98DB\u7FD4\u3059\u308B\u3002",
    "sn_dsc_0225"              : "\u30F4\u30A1\u30FC\u30EB\u5316\u3057\u305F\u5175\u58EB\u304C\u64CD\u7E26\u3059\u308B\u30EA\u30AC\u30FC\u30C9\u304C\u3001\u7121\u62B5\u6297\u306A\u5E02\u6C11\u306B\u8972\u3044\u639B\u304B\u308B\u3002\n\u305D\u306E\u4E00\u6483\u3092\u307E\u3068\u3082\u306B\u53D7\u3051\u3066\u3057\u307E\u3048\u3070\u3001\u3072\u3068\u305F\u307E\u308A\u3082\u306A\u3044\u3060\u308D\u3046\u3002",
    "sn_dsc_0226"              : "\u8B0E\u306E\u30D0\u30EB\u30AD\u30EA\u30FC\u90E8\u968A\u3092\u6307\u63EE\u3059\u308B\u7537\u306F\u3001\u773C\u93E1\u3092\u304B\u3051\u308B\u3068\u6226\u95D8\u958B\u59CB\u306E\u53F7\u4EE4\u3092\u767A\u3057\u305F\u3002\n\u300C\u3044\u3056\u98A8\u306B\u821E\u3048\u3001\u5929\u7A7A\u306E\u9A0E\u58EB\u305F\u3061\u3088\uFF01\u300D\u2015\u30ED\u30A4\u30C9",
    "sn_dsc_0227"              : "\u30E9\u30A4\u30D6\u306E\u958B\u59CB\u3068\u3068\u3082\u306B\u3001\u6575\u306E\u4F4D\u7F6E\u306A\u3069\u5FC5\u8981\u306A\u60C5\u5831\u3092\u96C6\u3081\u308B\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u3068\u30C7\u30EB\u30BF\u5C0F\u968A\u3002\n\u6570\u3005\u306E\u6700\u65B0\u6280\u8853\u306B\u3088\u3063\u3066\u6210\u308A\u7ACB\u3063\u3066\u3044\u308B\u5F7C\u5973\u305F\u3061\u306E\u30E9\u30A4\u30D6\u306F\u6226\u3044\u3067\u3082\u3042\u308B\u3002",
    "sn_dsc_0228"              : "\u30F4\u30A1\u30FC\u30EB\u306E\u767A\u751F\u304C\u78BA\u8A8D\u3055\u308C\u305F\u3068\u304D\u3001\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u306F\u6226\u5730\u3067\u30E9\u30A4\u30D6\u3092\u958B\u59CB\u3059\u308B\u3002\n\u6050\u6016\u306B\u304A\u3073\u3048\u3066\u3044\u308B\u4EBA\u3005\u306B\u5E0C\u671B\u3092\u898B\u305B\u308B\u305D\u306E\u59FF\u306F\u3001\u307E\u3055\u306B\u6226\u5834\u306E\u5973\u795E\u3060\u3002",
    "sn_dsc_0229"              : "\u30B8\u30EA\u30B8\u30EA\u3068\u8F1D\u304F\u592A\u967D\u306E\u4E0B\u3001\u71B1\u3044\u6D5C\u8FBA\u306B\u5973\u795E\u304C\u821E\u3044\u964D\u308A\u305F\u3002\n\u5F3E\u3051\u308B\u7B11\u9854\u306B\u6EA2\u308C\u308B\u7F8E\u8C8C\u3002\u5F7C\u5973\u306E\u7121\u9650\u306E\u9B45\u529B\u306B\u3001\u60F9\u304D\u3064\u3051\u3089\u308C\u306A\u3044\u8005\u306F\u3044\u306A\u3044\u3002",
    "sn_dsc_0230"              : "\u5C11\u3057\u6065\u305A\u304B\u3057\u305D\u3046\u306B\u7802\u6D5C\u306B\u7ACB\u3064\u3001\u6C34\u7740\u59FF\u306E\u30CA\u30CA\u30BB\u3002\n\u30E1\u30EA\u30CF\u30EA\u306E\u3042\u308B\u30DC\u30C7\u30A3\u30E9\u30A4\u30F3\u304C\u7537\u6027\u305F\u3061\u306E\u8996\u7DDA\u3092\u5F15\u304D\u4ED8\u3051\u308B\u3088\u3046\u3060\u3002",
    "sn_dsc_0231"              : "\u30DF\u30B7\u30A7\u30EB\u3068\u30AF\u30E9\u30F3\u306F\u5E7C\u99B4\u67D3\u306E\u95A2\u4FC2\u3067\u3042\u308A\u3001\u4E92\u3044\u306E\u3053\u3068\u306F\u3088\u304F\u77E5\u3063\u3066\u3044\u308B\u3002\n\u3060\u304C\u3001\u3088\u304F\u77E5\u3063\u305F\u4EF2\u3060\u304B\u3089\u3053\u305D\u3001\u809D\u5FC3\u306A\u3068\u3053\u308D\u3067\u7D20\u76F4\u306B\u306A\u308C\u306A\u3044\u3053\u3068\u3082\u3042\u308B\u3002",
    "sn_dsc_0232"              : "\u30B7\u30A7\u30EA\u30EB\u306E\u30DE\u30CD\u30FC\u30B8\u30E3\u30FC\u3067\u3042\u308B\u30B0\u30EC\u30A4\u30B9\u3082\u3001\u6C34\u7740\u306B\u7740\u66FF\u3048\u3066\u6D5C\u8FBA\u3092\u6B69\u3044\u3066\u3044\u305F\u3002\n\u5927\u4EBA\u306E\u9B45\u529B\u304C\u6EA2\u308C\u308B\u6C34\u7740\u59FF\u304B\u3089\u306F\u3001\u5C11\u3005\u5371\u967A\u306A\u9999\u308A\u304C\u6F02\u3046\u3002",
    "sn_dsc_0233"              : "\u30A4\u30BF\u30BA\u30E9\u597D\u304D\u306E\u30A6\u30DF\u30CD\u30B3\u3092\u8FFD\u3063\u3066\u6D77\u306B\u98DB\u3073\u8FBC\u3093\u3060\u30C1\u30E3\u30C3\u30AF\u3002\n\u3057\u304B\u3057\u30A6\u30DF\u30CD\u30B3\u306E\u7D20\u65E9\u3055\u306F\u5C0B\u5E38\u3067\u306F\u306A\u304F\u3001\u3055\u3059\u304C\u306E\u30C1\u30E3\u30C3\u30AF\u3067\u3082\u624B\u306B\u4F59\u308B\u3088\u3046\u3060\u3002",
