    "sn_dsc_0235"              : "\u5915\u65E5\u306B\u7167\u3089\u3055\u308C\u305F\u30B8\u30A7\u30D5\u30EA\u30FC\u306E\u6A2A\u9854\u3002\u305D\u308C\u3092\u5BC6\u304B\u306B\u898B\u3064\u3081\u308B\u30E2\u30CB\u30AB\u3002\n\u4E59\u5973\u306E\u5FC3\u3092\u77E5\u3063\u3066\u304B\u77E5\u3089\u305A\u304B\u3001\u6D77\u306E\u7537\u306F\u9759\u304B\u306B\u4F47\u3080\u3002",
