    "sn_dsc_0237"              : "\u30A2\u30EB\u30C8\u3068\u30E9\u30F3\u30AB\u304C\u5F85\u3061\u5408\u308F\u305B\u3092\u3057\u305F\u304A\u3057\u3083\u308C\u306A\u30AB\u30D5\u30A7\u3002\n\u6DBC\u3057\u3044\u65E5\u9670\u3067\u4F11\u61A9\u3059\u308B\u306B\u306F\u3082\u3063\u3066\u3053\u3044\u306E\u5834\u6240\u3067\u3042\u308B\u3002",
    "sn_dsc_0238"              : "\u30EA\u30BE\u30FC\u30C8\u8266\u5185\u306E\u30D3\u30FC\u30C1\u3067\u4F11\u3093\u3067\u3044\u308B\u7F8E\u5973\u3002\n\u9ED2\u3044\u808C\u306B\u30C8\u30ED\u30D4\u30AB\u30EB\u306A\u30B8\u30E5\u30FC\u30B9\u3001\u307E\u3055\u306B\u5E38\u590F\u3068\u3044\u3063\u305F\u88C5\u3044\u3067\u3042\u308B\u3002",
