    "sn_dsc_1978"              : "\u5165\u968A\u8A66\u9A13\u306B\u3066AI\u306E\u4ECB\u5165\u306B\u3088\u308A\u3001\u601D\u3046\u3088\u3046\u306B\u6A5F\u4F53\u3092\u64CD\u4F5C\u3067\u304D\u306A\u3044\u30CF\u30E4\u30C6\u3002\n\u3075\u3089\u3075\u3089\u3068\u4E0D\u5B89\u5B9A\u306B\u98DB\u3076\u6A5F\u4F53\u3092\u30DF\u30E9\u30FC\u30B8\u30E5\u306F\u8A66\u9A13\u5B98\u3068\u3057\u3066\u5BB9\u8D66\u306A\u304F\u8FFD\u3044\u8A70\u3081\u3066\u3044\u304F\u3002",
    "sn_dsc_1979"              : "\u60D1\u661F\u30E9\u30B0\u30CA\u306E\u6D77\u4E2D\u306B\u93AE\u5EA7\u3059\u308B\u30D7\u30ED\u30C8\u30AB\u30EB\u30C1\u30E3\u30FC\u306E\u907A\u8DE1\u3002\n\u5468\u308A\u306B\u306F\u30AF\u30E9\u30B2\u304C\u6F02\u3044\u3001\u795E\u79D8\u7684\u306A\u9759\u3051\u3055\u3092\u7E8F\u3063\u3066\u3044\u308B\u3002",
