    "sn_dsc_1984"              : "\u3077\u304B\u3077\u304B\u3068\u6CE2\u9593\u306B\u63FA\u3089\u308C\u306A\u304C\u3089\u898B\u4E0A\u3052\u308B\u590F\u306E\u7A7A\u306F\u3001\u683C\u5225\u306B\u723D\u5FEB\u306A\u3082\u306E\u304C\u3042\u308B\u3060\u308D\u3046\u3002\n\u305F\u3060\u3001\u6CB9\u65AD\u3057\u3066\u3044\u308B\u3068\u30A6\u30DF\u30CD\u30B3\u305F\u3061\u306E\u4E01\u5EA6\u3044\u3044\u4F11\u61A9\u5834\u6240\u306B\u3055\u308C\u3066\u3057\u307E\u3046\u304B\u3082\u3057\u308C\u306A\u3044\u3002",
