    "sn_dsc_1990"              : "\u6D77\u4E2D\u304B\u3089\u6D6E\u4E0A\u3057\u30DE\u30AF\u30ED\u30B9\u30FB\u30AD\u30E3\u30CE\u30F3\u3092\u653E\u3063\u305F\u30DE\u30AF\u30ED\u30B9\u30FB\u30A8\u30EA\u30B7\u30AA\u30F3\u3002\n\u8239\u4F53\u3092\u6EDD\u306E\u3088\u3046\u306B\u6D41\u308C\u308B\u5927\u91CF\u306E\u6D77\u6C34\u304C\u3001\u58EE\u89B3\u306A\u773A\u3081\u3092\u4F5C\u308A\u51FA\u3057\u3066\u3044\u308B\u3002",
